import React from 'react'
import Typewriter from '/typewriter-effect/dist/core';

export default function Typwriter() {
  return (
    <div>
      <Typewriter
        onInit={(typewriter) => {
          typewriter

            .typeString("GeeksForGeeks")

            .pauseFor(1000)
            .deleteAll()
            .typeString("Welcomes You")
            .start();
        }}
      />
      </div>
  );
}
